import React from 'react';
import './Home.css';
import NavigationBar from '../../commons/NavigationBar';

const SocialMedia = ({ icon }) => {
    return (
        <div>
            <img src={icon} />
        </div>
    )
};

const Home = () => {

    let ac = localStorage.getItem('account')
    let account = JSON.parse(ac)

    return (
        <>
            <div className='HomeContainer'>
                <div className='HomeContent'>
                    <NavigationBar text='Menu' />
                    <div className='HomeBody'>
                        <h3 className='HomeGreeting'> Hola, </h3>
                        <label className='HomeLabel'> 
                            {account.firstName}, como estas? 
                        </label>
                        <label className='HomeLabel'> 
                            Espero te haya gustado esta simple aplicacion web
                        </label>
                        <label className='HomeLabel'> 
                            Al utilizar la localStorage,
                            hay que tener en cuenta que si cierras tu cuenta
                            esta desaparecera, 
                            entonces deberas crear una nueva para volver a ingresar.
                        </label>
                        <div>
                            <SocialMedia />
                        </div>
                    </div>
                    <div className='Home' />
                </div>
                <div>
                    <iframe width="560" height="315" src="https://www.youtube.com/embed/jYRtFFa4hT8" 
                    title="YouTube video player" frameborder="0" 
                    allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen>
                    </iframe>
                </div>
            </div>
        </>
    )
};

export default Home;
